var ordencompraUrl=global_settings.urlCORS+"api/ordencompraapi/";registrationModule.factory("ordenCompraRepository",function(r){return{getEmptyMaestro:function(){return r.get(ordencompraUrl+"0-0")},getEmptyDetalle:function(){return r.get(ordencompraUrl+"1-0")},getAll:function(){return r.get(ordencompraUrl+"2-0")},getDetalle:function(n){return r.get(ordencompraUrl+"3-"+n)},actualizar:function(n,e,t,o){return r.get(ordencompraUrl+"4-"+n+"-"+e+"-"+t+"-"+o)},elimina:function(n){return r.post(ordencompraUrl+"5-"+n)},confirma:function(n){return r.get(ordencompraUrl+"6-"+n)},finaliza:function(n,e,t,o){return r.get(ordencompraUrl+"7-"+n+"-"+e+"-"+t+"-"+o)},add:function(n){return r.post(ordencompraUrl,n)},"delete":function(){return r["delete"](ordencompraUrl)},put:function(n){return r.put(ordencompraUrl,n)}}});